import React, { Fragment } from 'react';

const Post = ({ post }) => {
  return (
    <Fragment>
      <div>
        title:
        {post.title}
      </div>
      <div>
        author:
        {post.author}
      </div>
      <div>
        {post.id}
      </div>
      <div>
        {post.id}
      </div>
      <div>
        {post.id}
      </div>
    </Fragment>
  )
}

export default Post;
